import React from "react";
import Navbar from "../components/Navbar";

function Development() {
  return (
    <div>
      <Navbar />
      <h1>This page is under development</h1>
      <p>
        This is a demo page, to explore more of the main, page please click the
        button below or click on the Title in the top right corner.
      </p>
    </div>
  );
}

export default Development;
